/*Table structure for table `task_file` */

DROP TABLE IF EXISTS `task_file`;

CREATE TABLE `task_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务文件自增id',
  `date` char(8) DEFAULT NULL COMMENT '任务文件所在的日期',
  `table_name` char(50) DEFAULT NULL COMMENT '所属表名',
  `file_name` char(200) DEFAULT NULL COMMENT '文件名称',
  `content_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '文件内容(0其他|1结构|2数据)',
  `types` char(10) NOT NULL DEFAULT 'other' COMMENT '文件类型（all全量|add增量|ok验证文件|unSplit非分割文件|other其他文件）',
  `is_down` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已下载（0否是1）',
  `is_gz` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否压缩文件（0否1是）',
  `gz_do` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已解压（0否1是）',
  `db_do` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已进行分析入库（0否1是）',
  `db_do_start_time` datetime DEFAULT NULL COMMENT '分析开始时间',
  `db_do_end_time` datetime DEFAULT NULL COMMENT '分析结束时间',
  `line_num` int(11) NOT NULL DEFAULT '0' COMMENT '以及分析的行数',
  `has_err` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有错误（0无1有）',
  `err_msg` char(250) DEFAULT NULL COMMENT '错误信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=974 DEFAULT CHARSET=utf8;

