CREATE TABLE `task_time` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务执行自增id',
  `date` char(8) DEFAULT NULL COMMENT '日期文件夹',
  `start_time` datetime DEFAULT NULL COMMENT '任务开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '任务截止时间',
  `is_scan` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已经扫描（0未扫描1已扫描）',
  `state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '任务是否结束（0未开始1完成下载和解压2完成分析入库）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8;

